def alu_execute(command, registers):
    operator = command.pop(0)

    if operator == 'inp':
        # for reg in ('w', 'x', 'y', 'z'):
        #     print(f'registers[{reg}]={registers[reg]}', end=' ')
        # print()
        a, = command
        registers[a] = get_next_input()

    elif operator == 'add':
        a, b = command
        b = registers[b] if b.isalpha() else int(b)
        registers[a] += b

    elif operator == 'mul':
        a, b = command
        b = registers[b] if b.isalpha() else int(b)
        registers[a] *= b

    elif operator == 'div':
        a, b = command
        b = registers[b] if b.isalpha() else int(b)
        registers[a] //= b

    elif operator == 'mod':
        a, b = command
        b = registers[b] if b.isalpha() else int(b)
        registers[a] %= b

    elif operator == 'eql':
        a, b = command
        b = registers[b] if b.isalpha() else int(b)
        registers[a] = (1 if registers[a] == b else 0)


